        { as: Link, content: 'about', to: '/about' },
      ]
    return (<>
        <header>
            <h1>Layout Menu</h1>

        </header>
        {props.children}
        <style jsx>{`
            h1 {
                border-bottom: 1px solid gray;
            }
        `}
        </style>
    </>)
}
